css:
@font-face {
  font-family: 'Octicons Regular';
  src: url("octicons.woff") format("woff");
  font-weight: normal;
  font-style: normal;
}
html {
  font-family: 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  font-size: 11px;
}
html,
body {
  width: 100%;
  height: 100%;
  overflow: hidden;
}
atom-workspace {
  display: block;
  height: 100%;
  overflow: hidden;
  position: relative;
  color: #aaaaaa;
  background-color: #333333;
  font-family: 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
}
atom-workspace atom-workspace-axis.horizontal {
  display: -webkit-flex;
  height: 100%;
}
atom-workspace atom-workspace-axis.vertical {
  display: -webkit-flex;
  -webkit-flex: 1;
  -webkit-flex-flow: column;
}
.nav > li > a {
  border-radius: 2px;
}
.nav > li > a:hover {
  background-color: rgba(255, 255, 255, 0.07);
}
.nav.nav-pills > li.active > a {
  background-color: #4182c4;
}
h1,
h2,
h3,
h4,
h5,
h6 {
  font-family: inherit;
}
body {
  font-family: inherit;
  font-size: inherit;
}
.tooltip {
  font-family: 'Lucida Grande', 'Segoe UI', Ubuntu, Cantarell, sans-serif;
  font-size: 11px;
}
kbd {
  color: inherit;
  background-color: none;
  box-shadow: none;
}
.badge {
  display: inline-block;
  line-height: 1;
  vertical-align: middle;
  font-weight: normal;
  text-align: center;
  white-space: nowrap;
  border-radius: 1em;
  color: #ffffff;
  background-color: #4182c4;
  font-size: 11px;
  min-width: 17px;
  padding: 3px 5px;
}
.badge:empty {
  display: none;
}
.badge.badge-info {
  color: #ffffff;
  background-color: #0098ff;
}
.badge.badge-success {
  color: #ffffff;
  background-color: #17ca65;
}
.badge.badge-warning {
  color: #ffffff;
  background-color: #ffaa2c;
}
.badge.badge-error {
  color: #ffffff;
  background-color: #cc0000;
}
.badge.badge-large {
  font-size: 18px;
  min-width: 28px;
  padding: 5px 8px;
}
.badge.badge-medium {
  font-size: 14px;
  min-width: 22px;
  padding: 4px 6px;
}
.badge.badge-small {
  font-size: 10px;
  min-width: 16px;
  padding: 3px 5px;
}
.badge.badge-flexible {
  font-size: 0.8em;
  min-width: 1.6em;
  padding: 0.4em 0.6em;
}
.badge.icon {
  font-size: 13px;
  padding: 5px 10px;
}
.btn {
  color: #aaaaaa;
  border-radius: 2px;
  border: none;
  text-shadow: none;
  height: 27px;
  line-height: 25px;
  padding: 0 10px;
  font-size: 11px;
  z-index: 0;
  background-color: #43484d;
}
.btn:hover {
  background-color: #4f555b;
}
.btn.selected,
.btn.selected:hover {
  z-index: 1;
  background-color: #5c6064;
}
.btn.btn-xs,
.btn-group-xs > .btn {
  padding: 2.5px 5px;
  font-size: 9px;
  height: auto;
  line-height: 1.3em;
}
.btn.btn-sm,
.btn-group-sm > .btn {
  padding: 2.5px 5px;
  height: auto;
  line-height: 1.3em;
}
.btn.btn-lg,
.btn-group-lg > .btn {
  font-size: 13px;
  padding: 8px 12px;
  height: auto;
  line-height: 1.3em;
}
.btn-group > .btn {
  border-left: 1px solid rgba(0, 0, 0, 0.5);
  border-right: 1px solid rgba(0, 0, 0, 0.5);
}
.btn-group > .btn:first-child {
  border-left: none;
  border-top-left-radius: 2px;
  border-bottom-left-radius: 2px;
}
.btn-group > .btn:last-child,
.btn-group > .btn.selected:last-child,
.btn-group > .dropdown-toggle {
  border-right: none;
  border-top-right-radius: 2px;
  border-bottom-right-radius: 2px;
}
.btn-toolbar > .btn-group + .btn-group,
.btn-toolbar > .btn-group + .btn,
.btn-toolbar > .btn + .btn {
  float: none;
  display: inline-block;
  margin-left: 0;
}
.btn-toolbar > * {
  margin-right: 5px;
}
.btn-toolbar > *:last-child {
  margin-right: 0;
}
.icon::before {
  margin-right: 5px;
}
a.icon,
button.icon {
  text-decoration: none;
  color: #aaaaaa;
}
a.icon:hover,
button.icon:hover {
  color: #ffffff;
}
a {
  cursor: pointer;
  color: #ffffff;
}
a:hover {
  color: #ffffff;
  text-decoration: underline;
}
atom-pane-container {
  position: relative;
  display: -webkit-flex;
  -webkit-flex: 1;
}
atom-pane-container atom-pane-axis {
  display: -webkit-flex;
  -webkit-flex: 1;
}
atom-pane-container atom-pane-axis > atom-pane-resize-handle {
  position: absolute;
  z-index: 3;
}
atom-pane-container atom-pane-axis.vertical {
  -webkit-flex-direction: column;
}
atom-pane-container atom-pane-axis.vertical > atom-pane-resize-handle {
  width: 100%;
  height: 8px;
  margin-top: -4px;
  cursor: row-resize;
  border-bottom: none;
}
atom-pane-container atom-pane-axis.horizontal {
  -webkit-flex-direction: row;
}
atom-pane-container atom-pane-axis.horizontal > atom-pane-resize-handle {
  width: 8px;
  height: 100%;
  margin-left: -4px;
  cursor: col-resize;
  border-right: none;
}
atom-pane-container atom-pane {
  position: relative;
  display: -webkit-flex;
  -webkit-flex: 1;
  -webkit-flex-direction: column;
  overflow: visible;
}
atom-pane-container atom-pane .item-views {
  -webkit-flex: 1;
  display: -webkit-flex;
  min-height: 0;
  min-width: 0;
  position: relative;
}
atom-pane-container atom-pane .item-views .pane-item {
  color: #aaaaaa;
  background-color: #292c2f;
}
atom-pane-container atom-pane .item-views > *,
atom-pane-container atom-pane .item-views > atom-text-editor.react > * {
  position: absolute;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
}
.platform-win32 atom-pane-container atom-pane-axis.vertical > atom-pane-resize-handle {
  cursor: ns-resize;
}
.platform-win32 atom-pane-container atom-pane-axis.horizontal > atom-pane-resize-handle {
  cursor: ew-resize;
}
.panel {
  border-radius: 0;
  border: none;
  background-color: transparent;
  box-shadow: none;
}
.panel.bordered .panel-heading {
  border-radius: 2px 2px 0 0;
}
.inset-panel .panel-heading {
  border-radius: 2px 2px 0 0;
}
.panel-heading {
  margin: 0;
  padding: 10px;
  border-radius: 0;
  font-size: 11px;
  line-height: 1;
}
.panel-heading .btn {
  height: 20px;
  line-height: 20px;
  font-size: 9px;
  position: relative;
  top: -5px;
}
atom-panel-container.left,
atom-panel-container.right {
  display: -webkit-flex;
  -webkit-flex-direction: row;
  -webkit-align-items: stretch;
  height: 100%;
}
atom-panel-container.left atom-panel,
atom-panel-container.right atom-panel {
  height: 100%;
}
atom-panel {
  display: block;
}
atom-panel.top,
atom-panel.bottom,
atom-panel.left,
atom-panel.right {
  background-color: #1d1f21;
}
.tool-panel {
  position: relative;
  background-color: #1d1f21;
}
.overlay,
atom-panel.modal {
  position: absolute;
  left: 50%;
  width: 500px;
  margin-left: -250px;
  z-index: 9999;
  box-sizing: border-box;
  color: #aaaaaa;
  background-color: #202123;
  padding: 10px;
}
.overlay h1,
atom-panel.modal h1 {
  margin-top: 0;
  color: #ffffff;
  font-size: 1.6em;
  font-weight: bold;
}
.overlay h2,
atom-panel.modal h2 {
  font-size: 1.3em;
}
.overlay atom-text-editor[mini],
atom-panel.modal atom-text-editor[mini] {
  margin-bottom: 10px;
}
.overlay .message,
atom-panel.modal .message {
  padding-top: 5px;
  font-size: 11px;
}
.overlay.mini,
atom-panel.modal.mini {
  width: 200px;
  margin-left: -100px;
  font-size: 12px;
}
.overlay.from-top,
atom-panel.modal {
  top: 0;
  border-top: none;
  border-top-left-radius: 0;
  border-top-right-radius: 0;
}
.overlay.from-bottom {
  bottom: 0;
  border-bottom: none;
  border-bottom-left-radius: 0;
  border-bottom-right-radius: 0;
}
.overlay.floating {
  left: auto;
}
section,
.section {
  position: relative;
  margin-top: 0;
}
section:last-child,
.section:last-child {
  margin-bottom: 0;
}
section.bordered,
.section.bordered {
  margin: 0;
  padding: 20px 0;
  border-top: 1px solid rgba(255, 255, 255, 0.07);
  border-bottom: 1px solid rgba(0, 0, 0, 0.5);
}
section .section-heading:first-child,
.section .section-heading:first-child {
  margin-top: 0;
  font-weight: bold;
  color: #ffffff;
}
div > section:first-child,
form > section:first-child,
div > .section:first-child,
form > .section:first-child {
  border-top: none;
  padding-top: 0;
}
div > section:last-child,
form > section:last-child,
div > .section:last-child,
form > .section:last-child {
  border-bottom: none;
  padding-bottom: 0;
}
.list-group,
.list-group .list-group-item {
  background-color: transparent;
  border: none;
  padding: 0;
  margin: 0;
  position: static;
}
.list-group,
.list-tree {
  margin: 0;
  padding: 0;
  list-style: none;
  cursor: default;
}
.list-group li:not(.list-nested-item),
.list-tree li:not(.list-nested-item),
.list-group li.list-nested-item > .list-item,
.list-tree li.list-nested-item > .list-item {
  line-height: 25px;
  text-wrap: none;
  white-space: nowrap;
}
.list-group .selected::before,
.list-tree .selected::before {
  content: '';
  background-color: #4182c4;
  position: absolute;
  left: 0;
  right: 0;
  height: 25px;
}
.list-group .selected > *,
.list-tree .selected > * {
  position: relative;
}
.list-group .icon::before,
.list-tree .icon::before {
  margin-right: 5px;
  position: relative;
  top: 1px;
}
.list-group .no-icon,
.list-tree .no-icon {
  padding-left: 21px;
}
.list-tree .list-nested-item > .list-tree > li,
.list-tree .list-nested-item > .list-group > li {
  padding-left: 21px;
}
.list-tree.has-collapsable-children li.list-item {
  margin-left: 17px;
}
.list-tree.has-collapsable-children .list-nested-item.collapsed > .list-group,
.list-tree.has-collapsable-children .list-nested-item.collapsed > .list-tree {
  display: none;
}
.list-tree.has-collapsable-children .list-nested-item > .list-item::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 12px;
  width: 12px;
  height: 12px;
  content: "\f0a3";
}
.list-tree.has-collapsable-children .list-nested-item > .list-item::before {
  position: relative;
  top: -1px;
  margin-right: 5px;
}
.list-tree.has-collapsable-children .list-nested-item.collapsed > .list-item::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 12px;
  width: 12px;
  height: 12px;
  content: "\f078";
}
.list-tree.has-collapsable-children .list-nested-item.collapsed > .list-item::before {
  left: 1px;
}
.list-tree.has-collapsable-children .list-nested-item > .list-tree > li,
.list-tree.has-collapsable-children .list-nested-item > .list-group > li {
  padding-left: 17px;
}
.list-tree.has-collapsable-children .has-flat-children li.list-item,
.list-tree.has-collapsable-children.has-flat-children li.list-item {
  margin-left: 0;
}
.select-list.popover-list {
  width: 200px;
  min-width: 200px;
  margin-left: 0;
  position: relative;
}
.select-list.popover-list ol.list-group {
  position: relative;
  overflow-y: scroll;
  max-height: 200px;
}
.info-messages,
.error-messages {
  margin: 0;
  padding: 0;
  list-style: none;
}
.error-messages {
  color: #cc0000;
}
ul.background-message {
  font-size: 33px;
  margin: 0;
  padding: 0;
}
ul.background-message li {
  margin: 0;
  padding: 0;
  list-style: none;
}
ul.background-message.centered {
  display: -webkit-flex;
  position: absolute;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  -webkit-align-items: center;
  text-align: center;
}
ul.background-message.centered li {
  width: 100%;
}
.source.gfm .markup.heading {
  font-weight: bold;
}
.source.gfm .bold {
  font-weight: bold;
}
.source.gfm .italic {
  font-style: italic;
}
.source.gfm .comment.quote {
  font-style: italic;
}
atom-text-editor {
  display: block;
  font-family: Menlo, Consolas, 'DejaVu Sans Mono', monospace;
}
atom-text-editor[mini] {
  font-size: 14px;
  line-height: 25px;
  max-height: 27px;
  overflow: auto;
}
atom-overlay {
  position: absolute;
  display: block;
  z-index: 4;
}
atom-text-editor {
  display: -webkit-flex;
}
atom-text-editor .editor-contents {
  width: 100%;
  overflow: hidden;
  cursor: text;
  display: -webkit-flex;
  -webkit-user-select: none;
  position: relative;
}
atom-text-editor .gutter {
  overflow: hidden;
  text-align: right;
  cursor: default;
  min-width: 1em;
  box-sizing: border-box;
}
atom-text-editor .line-numbers {
  position: relative;
}
atom-text-editor .line-number {
  position: relative;
  white-space: nowrap;
  padding-left: .5em;
  opacity: 0.6;
}
atom-text-editor .line-number.cursor-line {
  opacity: 1;
}
atom-text-editor .line-number .icon-right {
  display: inline-block;
  visibility: hidden;
  opacity: .6;
  padding: 0 .4em;
}
atom-text-editor .line-number .icon-right::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 0.8em;
  width: 0.8em;
  height: 0.8em;
  content: "\f0a3";
}
atom-text-editor .line-number .icon-right::before {
  text-align: center;
}
atom-text-editor .gutter:hover .line-number.foldable .icon-right {
  visibility: visible;
}
atom-text-editor .gutter:hover .line-number.foldable .icon-right:hover {
  opacity: 1;
}
atom-text-editor .gutter .line-number.folded .icon-right,
atom-text-editor .gutter:hover .line-number.folded .icon-right {
  visibility: visible;
}
atom-text-editor .gutter .line-number.folded .icon-right::before,
atom-text-editor .gutter:hover .line-number.folded .icon-right::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 0.8em;
  width: 0.8em;
  height: 0.8em;
  content: "\f078";
}
atom-text-editor .gutter .line-number.folded .icon-right::before,
atom-text-editor .gutter:hover .line-number.folded .icon-right::before {
  position: relative;
  left: -0.1em;
}
atom-text-editor .scroll-view {
  position: relative;
  z-index: 0;
  overflow: hidden;
  -webkit-flex: 1;
  min-width: 0;
}
atom-text-editor .highlight {
  background: none;
  padding: 0;
}
atom-text-editor .highlight .region {
  position: absolute;
  pointer-events: none;
  z-index: -1;
}
atom-text-editor .lines {
  min-width: 100%;
  position: relative;
  z-index: 1;
}
atom-text-editor .line {
  white-space: pre;
}
atom-text-editor .line.cursor-line .fold-marker::after {
  opacity: 1;
}
atom-text-editor .fold-marker {
  cursor: default;
}
atom-text-editor .fold-marker::after {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 0.8em;
  width: 0.8em;
  height: 0.8em;
  content: "\f09a";
  padding-left: 0.2em;
}
atom-text-editor .placeholder-text {
  position: absolute;
  color: #555555;
}
atom-text-editor .invisible-character {
  font-weight: normal !important;
  font-style: normal !important;
}
atom-text-editor .indent-guide {
  display: inline-block;
  box-shadow: inset 1px 0;
}
atom-text-editor .hidden-input {
  padding: 0;
  border: 0;
  position: absolute;
  z-index: -1;
  top: 0;
  left: 0;
  opacity: 0;
  width: 1px;
}
atom-text-editor .cursor {
  z-index: 4;
  pointer-events: none;
  box-sizing: border-box;
  position: absolute;
  border-left: 1px solid;
  opacity: 0;
}
atom-text-editor.is-focused .cursor {
  opacity: 1;
}
atom-text-editor .cursors.blink-off .cursor {
  opacity: 0;
}
atom-text-editor .horizontal-scrollbar {
  position: absolute;
  left: 0;
  right: 0;
  bottom: 0;
  height: 15px;
  overflow-x: auto;
  overflow-y: hidden;
  z-index: 3;
  cursor: default;
}
atom-text-editor .horizontal-scrollbar .scrollbar-content {
  height: 15px;
}
atom-text-editor .vertical-scrollbar {
  position: absolute;
  top: 0;
  right: 0;
  bottom: 0;
  width: 15px;
  overflow-x: hidden;
  overflow-y: auto;
  z-index: 3;
  cursor: default;
}
atom-text-editor .scrollbar-corner {
  position: absolute;
  overflow: auto;
  bottom: 0;
  right: 0;
}
.select-list .loading .loading-message::before {
  font-family: 'Octicons Regular';
  font-weight: normal;
  font-style: normal;
  display: inline-block;
  line-height: 1;
  -webkit-font-smoothing: antialiased;
  text-decoration: none;
  font-size: 16px;
  width: 16px;
  height: 16px;
  content: "\f09e";
}
.select-list .loading .loading-message:before {
  font-size: 1.1em;
  width: 1.1em;
  height: 1.1em;
  margin-right: 5px;
}
.select-list .loading .badge {
  margin-left: 10px;
}
.select-list ol.list-group {
  position: relative;
  overflow-y: auto;
  max-height: 312px;
  margin: 10px 0 0 0;
  padding: 0;
}
.select-list ol.list-group li {
  display: block;
}
.select-list ol.list-group li .primary-line,
.select-list ol.list-group li .secondary-line {
  text-overflow: ellipsis;
  white-space: nowrap;
  overflow: hidden;
}
atom-text-editor .lines .markup.git-commit.changed {
  color: #e9c062;
}
atom-text-editor .lines .markup.git-commit.deleted {
  color: #cc6666;
}
atom-text-editor .lines .markup.git-commit.inserted {
  color: #a8ff60;
}
@-webkit-keyframes flash {
  from {
    background-color: #eeeeee;
  }
  to {
    background-color: null;
  }
}
atom-text-editor .flash.selection .region {
  -webkit-animation-name: flash;
  -webkit-animation-duration: .5s;
  -webkit-animation-iteration-count: 1;
}
.text-info code {
  color: #5293d8;
  background: rgba(0, 152, 255, 0.2);
}
.text-info a,
.text-info a code {
  text-decoration: underline;
  color: #2d79ca;
}
.text-info a:hover,
.text-info a code:hover {
  color: #296db5;
}
.text-success code {
  color: #2bda77;
  background: rgba(23, 202, 101, 0.2);
}
.text-success a,
.text-success a code {
  text-decoration: underline;
  color: #1fb35f;
}
.text-success a:hover,
.text-success a code:hover {
  color: #1b9d54;
}
.text-warning code {
  color: #ff982d;
  background: rgba(255, 170, 44, 0.2);
}
.text-warning a,
.text-warning a code {
  text-decoration: underline;
  color: #f97f00;
}
.text-warning a:hover,
.text-warning a code:hover {
  color: #e07200;
}
.text-error code {
  color: #cc0000;
  background: rgba(204, 0, 0, 0.2);
}
.text-error a,
.text-error a code {
  text-decoration: underline;
  color: #990000;
}
.text-error a:hover,
.text-error a code:hover {
  color: #800000;
}
:focus {
  outline: none;
}
.pull-center {
  margin-left: auto;
  margin-right: auto;
}
.padded {
  padding: 10px;
}
ul.block,
div.block {
  margin-bottom: 10px;
}
div > ul.block:last-child,
div > div.block:last-child {
